let touchStart=null;function jump(b){const c=document.getElementById("list_date"),a=document.getElementById("adminForm");c.value=b;a.submit()}window.addEventListener("touchstart",function(a){if(a.touches.length===1){touchStart=a.touches.item(0).clientX}});window.addEventListener("touchend",function(a){const b=100,c=Joomla.getOptions("variables",{});let touchEnd=null;if(touchStart){touchEnd=a.changedTouches.item(0).clientX;if(touchEnd>touchStart+b){jump(c.yesterday)}if(touchEnd<touchStart-b){jump(c.tomorrow)}}});